import Navbar from "./components/nav";
import JobCard from "./components/job";

function Home() {
  const jobs = [
    {
      id: 1,
      title: "React UI Developer",
      company: "Tech Solutions",
      location: "Bangalore",
      salary: "₹4 - 6 LPA",
    },
    {
      id: 2,
      title: "Frontend Developer",
      company: "Startup Hub",
      location: "Hyderabad",
      salary: "₹3 - 5 LPA",
    },
    {
      id: 3,
      title: "UI Developer (Fresher)",
      company: "Innovatech",
      location: "Chennai",
      salary: "₹3 - 4 LPA",
    },
  ];

  return (
    <div>
      <Navbar />
      <h1 style={{ textAlign: "center", marginTop: "20px" }}>
        Latest Job Openings
      </h1>

      <div style={styles.container}>
        {jobs.map((job) => (
          <JobCard
            key={job.id}
            title={job.title}
            company={job.company}
            location={job.location}
            salary={job.salary}
          />
        ))}
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: "flex",
    flexWrap: "wrap",
    justifyContent: "center",
    marginTop: "20px",
  },
};

export default Home;
